import{_ as c}from"./chunks/index.VAya1KE4.js";import{c as a,o,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":73,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":73,"name":"11号","summary":"「11号」","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/25/76099754/41cac9b7c43299248f50ef69a8d4d6fe_9121267123322404.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/f9cb53893ca3fd65007fdc9297de9cf6_5128780415690328236.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/ba1179ef71bdcdab123faf0b3643c2a2_6673063951597428119.png"},"attrs":[["稀有度","S"],["属性","火"],["特性","强攻"],["阵营","奥波勒斯小队"]],"destiny":[["LEVEL1快速升温","进入接战状态或换入前场时，若「11号」的能量不足40点，则立即回复至80点，50秒内最多触发一次。长期的高强度实战训练让「11号」掌握了对于自身状态的调控。她会竭尽全力，保证以最好的状态迎接每一场战斗。"],["LEVEL2高温汇聚","触发[火力镇压]时，[普通攻击]、[冲刺攻击]、[闪避反击]造成的伤害提升3%，最多叠加12层，持续15秒，每层效果单独结算时间。「虽然她看起来又冷又硬，跟个大冰块似的…」「实际上内心却是滚烫滚烫的呢，就像有火在燃烧。」——来自黑曜石营内一位匿名的军人"],["LEVEL3精锐士兵","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2不论是训练还是实战，「11号」从来都是以最高标准要求自己，故而能一直拥有高标准的战斗力。"],["LEVEL4纵情燃烧","[普通攻击]第一、二、三段或[冲刺攻击]发动时，若触发[火力镇压]，则在招式发动期间抗打断等级提升，受到的伤害降低18%；[普通攻击]第四段发动时，若触发[火力镇压]，则在招式发动期间获得无敌效果。她很羡慕火焰。而这些尽情燃烧着的火焰，也总会帮到她。"],["LEVEL5完美士兵","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2从精锐到楷模是一次漫长的跨越，但「11号」依然咬牙坚持着，似乎暗中有些什么理由一直鞭策着她向完美士兵这一目标努力…"],["LEVEL6炽热心流","发动[强化特殊技]、[连携技]或[终结技]时，「11号」获得8层充能（上限8层）；触发[火力镇压]时，消耗1层充能，使当前招式无视目标25%火属性伤害抗性。剑刃的火焰撩起热浪，银发少女的战斗越来越热烈，那份热度仿佛顺着呼吸渗入了精神，连思考也变得炽热起来。"]],"skill":[{"title":"普通攻击：热身火花","desc":"点按发动：向前方进行至多四段的斩击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/ce82d4e47dcf9c521380fc052273cc9f_5974393971293493356.gif"},{"title":"普通攻击：火力镇压","desc":"在恰当的时机点按发动：发动更为强力的斩击，造成火属性伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/405311c42f5a0589eb61423333d02583_4503822689856557136.gif"},{"title":"闪避：退火","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/cb4ff79cd7784c8b6c41921936f8632d_861545703535094287.gif"},{"title":"冲刺攻击：炽火","desc":"闪避时，点按发动：向前方进行斩击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/26de7fa181b3680c000eb44cade736c1_5774867545019341004.gif"},{"title":"冲刺攻击：火力镇压","desc":"闪避时，点按发动：向前方进行斩击，造成火属性伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/a97a5c22cd748e981fca3ceac8caa546_5330968675095702959.gif"},{"title":"闪避反击：逆火","desc":"触发[极限闪避]后，点按发动：对前方敌人发动强力斩击，造成大量火属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/56c6c91fecbc318e8a797c73f8205ee0_1884727590217385695.gif"},{"title":"快速支援：火力掩护","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动斩击，造成火属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/21e576e656722925c39f48aa900b616f_3770482888186937371.gif"},{"title":"招架支援：巩固防线","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/84a411072fe59774d702563bc0426ce4_352128075521555354.gif"},{"title":"支援突击：重燃","desc":"发动[招架支援]后，点按发动：对前方敌人发动交叉斩击，造成火属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/a0df7e0be8a87a7bb1acb731d82ce5d1_3453768821831143421.gif"},{"title":"特殊技：烈火","desc":"点按发动：向身周进行斩击，造成火属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/2e2fea0ab1c022e49624fc9959d41ab3_8385230080700967693.gif"},{"title":"强化特殊技：盛燃烈火","desc":"能量足够时，点按发动：向身周进行强力斩击，造成大量火属性伤害；招式发动期间拥有无敌效果。招式发动后，[普通攻击]和[冲刺攻击]必定触发[火力镇压]，最多持续15秒或触发8次；","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/a09c68284b39300bc90f98778c41cab1_8288335239465901323.gif"},{"title":"连携技：昂扬烈焰","desc":"触发[连携技]时，选择对应角色发动：对前方小范围敌人进行强力上挑斩击，造成大量火属性伤害；招式发动后，[普通攻击]和[冲刺攻击]必定触发[火力镇压]，最多持续15秒或触发8次；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/320eafa9be29f2b3acc3184e36fd2acb_9138558383941750958.gif"},{"title":"终结技：轰鸣烈焰","desc":"喧响等级达到[极]时，点按发动：对前方小范围敌人进行强力上挑斩击，造成大量火属性伤害；招式发动后，[普通攻击]和[冲刺攻击]必定触发[火力镇压]，最多持续15秒或触发8次；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/6c71a7d1694d6d9b8601cc2dd5011f67_3574197123059192614.gif"},{"title":"核心技","desc":"核心被动：热浪「11号」在[普通攻击]或[冲刺攻击]中触发[火力镇压]时，招式造成的伤害提升35%。（此处数据为初始数据）额外能力：燎原队伍中存在与自身属性或阵营相同的角色时触发：「11号」造成的火属性伤害提升10%，攻击处于失衡状态下的敌人时，该增益效果额外提升22.5%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/25/82232455/bd765c2e2825619e38ee65f146c2bd1c_1453107688111063286.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/73.md","filePath":"game/zzz/role/[pkg].md"}'),i={name:"game/zzz/role/73.md"},_=Object.assign(i,{setup(d){return(p,n)=>(o(),a("div",null,[e(t(c))]))}});export{b as __pageData,_ as default};
